def countNegativewords(wordlistDict, negativewords):
    number = 0;
    for i in range(len(wordlistDict)):
        if wordlistDict[i][1] in negativewords:
            number += 1;
    return number;


def countPositivewords(wordlistDict, positivewords):
    number = 0;
    for i in range(len(wordlistDict)):
        if wordlistDict[i][1] in positivewords:
            number += 1;
    return number;


def removeStopwords(wordlist, stopwords): #O(nm)
    return [w for w in wordlist if w not in stopwords]


def removeDigit(wordlist):
    return [w for w in wordlist if w.isdigit() == False]


def removeSingleWord(wordlist):
    return [w for w in wordlist if len(w) > 1]


def stripNonAlphaNum(text):
    return re.compile(r'\W+', re.UNICODE).split(text) #0-9, a-z, A-Z, _


def wordListToFreqDict(wordlist):
    wordfreq = [wordlist.count(p) for p in wordlist]
    return dict(list(zip(wordlist, wordfreq)))


def sortFreqDict(freqdict):
    aux = [(freqdict[key], key) for key in freqdict]
    aux.sort()
    aux.reverse()
    return aux


def sortFreqDictMine(freqdict):
    aux = [key for key in freqdict]
    aux.sort()
    return aux


def stripTags(pageContents):
    startLoc = pageContents.find("<p>")
    endLoc = pageContents.rfind("</p>")

    pageContents = pageContents[startLoc:endLoc]

    inside = 0
    text = ''

    for char in pageContents:
        if char == '<':
            inside = 1
        elif (inside == 1 and char == '>'):
            inside = 0
        elif inside == 1:
            continue
        else:
            text += char
    return text

positiveWords = 'https://positivewordsresearch.com/list-of-positive-words/'
negativeWords = 'https://positivewordsresearch.com/list-of-negative-words/'
train = 'https://penanglocal.com/2019/01/21/kuala-lumpur-to-penang-by-train-travel-review/'
bus = 'https://www.bookaway.com/blog/a-luxury-bus-ride-from-penang-to-kuala-lumpur-a-guest-review'
flight = 'https://flight-report.com/en/report/29844/Air-Asia-AK6112-Kuala-Lumpur-KUL-Penang-PEN'
grab = 'https://www.thestar.com.my/opinion/letters/2018/10/29/why-grab-leads-the-way-in-transport-service'

urlList = [train, bus, flight, grab]

for url in urlList:
    print(url)
    response = urllib.request.urlopen(url)
    HTML = response.read()
    text = stripTags(HTML.decode("utf-8").lower())
    fullwordlist = stripNonAlphaNum(text)
    wordlist = removeStopwords(fullwordlist, stopwords)
    wordlist = removeDigit(wordlist)
    wordlist = removeSingleWord(wordlist)
    dictionary = wordListToFreqDict(wordlist)
    sorteddict = sortFreqDict(dictionary)
    # for s in sorteddict: print(str(s))
    number = 0
    for s in sorteddict:
        number += int(s[0])
    print(number)
    print(countNegativewords(sorteddict, negativewords))
    print(countPositivewords(sorteddict, positivewords))

